 // src/App.js
import React from 'react';

const styles = {
  body: {
    margin: 0,
    fontFamily: '-apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif',
  },
  app: {
    textAlign: 'center',
  },
  header: {
    backgroundColor: '#333',
    color: 'white',
    padding: '20px',
  },
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
  },
  navUl: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'space-between',  // Adjusted for login button
    alignItems: 'center', // Center align items vertically
  },
  navLi: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  main: {
    padding: '20px',
  },
  footer: {
    backgroundColor: '#333',
    color: 'white',
    padding: '20px',
    position: 'fixed',
    bottom: 0,
    width: '100%',
  },
  loginButton: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
  },
};

const Header = () => {
  return (
    <header style={styles.header}>
      <h1>My Responsive Website</h1>
    </header>
  );
};

const NavBar = () => {
  return (
    <nav style={styles.nav}>
      <ul style={styles.navUl}>
        <li style={styles.navLi}>Home</li>
        <li style={styles.navLi}>About</li>
        <li style={{ ...styles.navLi, ...styles.loginButton }}>Login</li>
      </ul>
    </nav>
  );
};

const MainContent = () => {
  return (
    <main style={styles.main}>
      <p>Welcome to my website! This is the main content.</p>
    </main>
  );
};

const Footer = () => {
  return (
    <footer style={styles.footer}>
      <p>&copy; 2024 My Website. All rights reserved.</p>
    </footer>
  );
};

function App() {
  return (
    <div style={styles.app}>
      <Header />
      <NavBar />
      <MainContent />
      <Footer />
    </div>
  );
}

export default App;
